import AppContext from '../../context/appContext';

const Perfil = () => {
	const { user } = useContext(AppContext);
	const { name, app, username } = user;

	return(
		<div>
			<small>Bienvenido:</small> 
			<p>{name} {app}</p>
		</div>
	)
}

export default Perfil;
